import React from 'react'

const FirstInput = ({inputValue , setInputValue}) => {
  return (

         <input
          className="inputField"
          type="text"
          name="inputField"
          placeholder="Dream, Plan, Do!"
          required
          value={inputValue}
          onChange={(e) => setInputValue(e.target.value)}
        />

  )
}

export default FirstInput
